import{aF as t,e as d,f as r,V as e}from"./chunks/framework.54wzUQT-.js";const a="/vue-super-ui/assets/1.0ijavn8Q.png",f=JSON.parse('{"title":"八进制","description":"","frontmatter":{},"headers":[],"relativePath":"docs/文章/计算机相关/进制/八进制.md","filePath":"docs/文章/计算机相关/进制/八进制.md","lastUpdated":1716277301000}'),o={name:"docs/文章/计算机相关/进制/八进制.md"},c=e('<h1 id="八进制" tabindex="-1">八进制 <a class="header-anchor" href="#八进制" aria-label="Permalink to &quot;八进制&quot;">​</a></h1><p>八进制，Octal，缩写 OCT 或 O，一种以 8 为基数的计数法，采用 0，1，2，3，4，5，6，7 八个数字，逢八进 1。一些编程语言中声明变量时常常以数字 0 开头表明该数字是八进制。</p><p>八进制的数和二进制数可以按位对应（八进制一位对应二进制三位），因此常应用在计算机语言中。</p><table><thead><tr><th>十进制</th><th>八进制</th></tr></thead><tbody><tr><td>0</td><td>0</td></tr><tr><td>1</td><td>1</td></tr><tr><td>2</td><td>2</td></tr><tr><td>3</td><td>3</td></tr><tr><td>4</td><td>4</td></tr><tr><td>5</td><td>5</td></tr><tr><td>6</td><td>6</td></tr><tr><td>7</td><td>7</td></tr><tr><td>8</td><td>10</td></tr><tr><td>9</td><td>11</td></tr><tr><td>10</td><td>12</td></tr><tr><td>11</td><td>13</td></tr><tr><td>12</td><td>14</td></tr><tr><td>13</td><td>15</td></tr><tr><td>14</td><td>16</td></tr><tr><td>15</td><td>17</td></tr><tr><td>16</td><td>20</td></tr></tbody></table><h2 id="十进制转八进制" tabindex="-1">十进制转八进制 <a class="header-anchor" href="#十进制转八进制" aria-label="Permalink to &quot;十进制转八进制&quot;">​</a></h2><p>除八反序取余法，用十进制数除以 8，分别取余数和商数，商数为 0 的时候，将余数倒着数就是转化后的结果。</p><p><img src="'+a+'" alt="十进制转八进制" loading="lazy"></p><p>最后十进制 4567 用八进制以 10727 表示</p><h2 id="八进制转十进制" tabindex="-1">八进制转十进制 <a class="header-anchor" href="#八进制转十进制" aria-label="Permalink to &quot;八进制转十进制&quot;">​</a></h2><p>权值法，将一个八进制数从末尾（右边）开始数个数，假设为 n，乘以 8 的 n 次幂，n 从 0 开始。</p><p>如八进制数<code>173</code>：</p><p><code>[八进制的数] * 8^[n]</code></p><ul><li><code>3 * 8^0 = 3</code></li><li><code>7 * 8^1 = 56</code></li><li><code>1 * 8^2 = 64</code></li></ul><p>最后相加<code>3+56+64 = 123</code>，123 就是转换成十进制的结果</p>',14),s=[c];function i(l,n,p,_,h,u){return d(),r("div",null,s)}const b=t(o,[["render",i]]);ex